import React from "react"; 

const Anime =()=>{
    const [anime, setAnime]= React.useState([]); 

    React.useEffect(()=> {
        const char="saitama"; 

        fetch(`https://animechan.vercel.app/api/quotes/character?name=${char}`)
        .then((response) => response.json())
        .then((quotes) => (quotes));

    }, []);

    return(
        <div className="anime">
            {anime?.map((item)=>
                (
                    <div key={item.id}>
                        <p>{item.char}</p>
                    </div>

                ))}
        </div>
    );
};

export default Anime;
